import {Card} from 'react-bootstrap';


const FooterComponent = () => {
    return(
        <Card bg='dark'>
        <Card.Header as="h5">Anime Bakari</Card.Header>
        <Card.Body>
          <Card.Title as="small"><small>All rights Reserved</small></Card.Title>
          <Card.Text as="small">
           <small>With supporting text below as a natural lead-in to additional content.</small> 
          </Card.Text>
        </Card.Body>
      </Card>
    );
}

export default FooterComponent;
